import React from "react";
import './Engagement.css';

function Engagement() {
    return (
        <div className='clap-heart'>
            <span className='clap-and-count'>
                <img src='../../assets/clapping.svg' alt='' />
                    <span>10</span>
            </span>

            <img src='../../assets/heart-red.svg' alt='' />
        </div>
    )
}

export default Engagement;
